import { useFormik } from "formik";
import React from "react";
import * as Yup from "yup";
import { object, string, number, date, InferType} from 'yup';

function Register() {
  function handleSubmit(values) {
    console.log("hello", values);
  }

  let formik = useFormik({
    initialValues: {
      name: "",
      email: "",
      password: "",
      rePassword: "",
      phone: "",
    },
    validationSchema: Yup.object({
     
        name: Yup.string().required().min(3).max(20),
        email: Yup.string().required().email(),
        password: Yup.string().required().matches(/[A-Z][a-z0-9]{3,9}/,"Password is Invalid "),
        rePassword: Yup.string().required().oneOf([Yup.ref('password')]),
        phone: Yup.string().required().matches(/^01[0125]\d{8}$/,"Phone is Invalid"),
      }),
    onSubmit: handleSubmit,
  });

  return (
    <>
      <div className="w-75 mx-auto ">
        <h2 className="">Register Now</h2>

        <form onSubmit={formik.handleSubmit}>
          <div className="form-group my-2">
            <label htmlFor="name">Name</label>
            <input
              type="text"
              name="name"
              id="name"
              className="form-control"
              value={formik.values.name}
              onBlur={formik.handleBlur}
              onChange={formik.handleChange}
            />
             {formik.touched.name && formik.errors.name ? (
        <div className="alert alert-danger">{formik.errors.name}</div>
       ) : null}
 
          </div>
          <div className="form-group my-2">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              name="email"
              id="email"
              className="form-control"
              value={formik.values.email}
              onChange={formik.handleChange}
              onBlur={formik.handleBlur}
            />
             {formik.touched.email && formik.errors.email ? (
         <div className="alert alert-danger">{formik.errors.email}</div>
       ) : null}
          </div>
          <div className="form-group my-2">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              name="password"
              id="password"
              className="form-control"
              value={formik.values.password}
              onChange={formik.handleChange}
              onBlur={formik.handleBlur}
            />
             {formik.touched.password && formik.errors.password ? (
        <div className="alert alert-danger">{formik.errors.password}</div>
       ) : null}
          </div>
        
          <div className="form-group my-2">
            <label htmlFor="phone">Phone</label>
            <input
              type="tel"
              name="phone"
              id="phone"
              className="form-control"
              value={formik.values.phone}
              onChange={formik.handleChange}
              onBlur={formik.handleBlur}
              />
               {formik.touched.phone && formik.errors.phone ? (
         <div className="alert alert-danger">{formik.errors.phone}</div>
         ) : null}
          </div>
          <button type="submit" className="btn bg-primary">
            Register
          </button>
        </form>
      </div>
    </>
  );
}

export default Register;
